import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import FirstComponent from './components/learning-examples/FirstComponent.jsx';
import SecondComponent from './components/learning-examples/FirstComponent.jsx';
import ThirdComponent from './components/learning-examples/FirstComponent.jsx';
import Counter from './components/counter/counter.jsx';

class App extends Component {
  render() {
    return (
      <div className = "App">
        My Hello World
      </div>
    );
  }
}

class learning extends Component{
  render(){
    return (
      <div className="learning">
      My Hello World
      <FirstComponent/>
      <SecondComponent/>
      <ThirdComponent/>
    </div>
    );
  }
}


export default App;
